import React, { useEffect, useMemo } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { useState } from "react";

const DetailsOfQuestion = () => {
  const [questionData, setQuestionData] = useState([]);
  const [hasoptionA, sethasOptionA] = useState("");
  const [hasoptionB, sethasOptionB] = useState("");
  const [hasoptionC, sethasOptionC] = useState("");

  const [hasoptionD, sethasOptionD] = useState("");

  const [hasoptionE, sethasOptionE] = useState("");

  const params = useParams();
  const questionId = params.questionId;
  const topicName = params.topicName;
  const examId = params.examId;
  const navigate = useNavigate();
  console.log("Topic Name....>", topicName);
  console.log("Question Id...>", questionId);
  var topicId;
  var myobj;
  var optionA = "Hello";
  console.log("...", optionA);

  async function questionDetails() {
    console.log("question Details is called....");
    console.log(questionId);
    const map = {
      questionId: questionId,
    };

    const response = await fetch(
      "https://localhost:8443/onlineexam/control/questionMasterList",
      {
        method: "POST",
        credentials: "include",
        body: JSON.stringify(map),
        headers: {
          "Content-type": "application/json",
        },
      }
    );

    const result = await response.json();
    console.log("result....>", result);
    myobj = result.getRecord;
    console.log("Myobj....>", myobj);
    console.log("optionA...>", optionA);
    console.log("Data..>", questionData);

    console.log("result.getrecord", result.getRecord);
    topicId = result.getRecord.topicId;
    console.log(result.getRecord.optionA);
    sethasOptionA(result.getRecord.optionA);
    optionA = result.getRecord.optionA;
    console.log("My option A...>", optionA);
  }
  console.log("OPTION A:" + hasoptionA);

  useEffect(() => {
    questionDetails();
  }, []);

  return (
    <div className="my-5">
      <div className="d-flex shadow">
        <p className="text-primary font-weight-bold my-2 mx-2">
          Question Detail -{" "}
        </p>
        <div className="my-2 text-uppercase font-weight-bold">
          {questionData.questionDetail}
        </div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option A - </p>
        <p className="my-2 ">{hasoptionA}</p>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option B - </p>
        <div className="my-2">{questionData.optionB}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option C - </p>
        <div className="my-2">{questionData.optionC}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option D - </p>
        <div className="my-2">{questionData.optionD}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Option E - </p>
        <div className="my-2">{questionData.optionE}</div>
      </div>
      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Answer - </p>
        <div className="my-2">{questionData.answer}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">TopicName - </p>
        <div className="my-2">{topicName}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">QuestionType - </p>
        <div className="my-2">{questionData.questionType}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">AnswerValue - </p>
        <div className="my-2">{questionData.answerValue}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">DifficultyLevel - </p>
        <div className="my-2">{questionData.difficultyLevel}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">Num Answers - </p>
        <div className="my-2">{questionData.numAnswers}</div>
      </div>

      <div className="d-flex shadow">
        <p className="text-primary my-2 mx-2">NegativeMarkValue - </p>
        <div className="my-2">{questionData.negativeMarkValue}</div>
      </div>

      <button
        className="btn btn-primary my-5"
        onClick={navigate(
          `/updateExam/examdetails/question-topicView/${topicId}/${examId}`
        )}
      >
        Back
      </button>
      <button className="btn btn-primary offset-9 my-5">Edit</button>
    </div>
  );
};

export default DetailsOfQuestion;
